export const increment = () => {
    return {
        type: 'INCREMENT'
    };
}

export const decrement = () => {
    return{
        type: 'DECREMENT'
    }
}

export const user = (e) => {
    e.prevent.default();
    return{
        type: 'USER',
        data: e.target.value
    }
}
